import React from "react";
import styled from "styled-components";

const WrapperSolution = styled.div`
	width: 28%;
`;

const SolutionImg = "../images/check.png";
const ImgSolution = styled.img`
	width: 50px;
	height: 50px;
`;

const WrapperInfo = styled.div`
	// display: flex;
	// flex-direction: column;
`;

const TitleInfo = styled.h3``;

const TextInfo = styled.p``;

const WrapperLink = styled.div``;

const ArrowImg = "../images/rightarrow.png";
const ImgArrow = styled.img`
	width: 20px;
	height: 20px;
	margin-right: 10px;
	margin-bottom: -5px;
`;

const Anchor = styled.a`
	color: #2eccfa;
`;

class Develop extends React.Component {
	render() {
		return (
			<WrapperSolution>
				<ImgSolution src={SolutionImg} />
				<WrapperInfo>
					<TitleInfo>Roadmap to succes</TitleInfo>
					<TextInfo>
						Lorem Ipsum is simply dummy text of the printing and typesetting
						industry. Lorem Ipsum has been the industry's standard dummy text
						ever since the 1500s, when an unknown printer took a galley of type
						and scrambled it to make a type specimen book.
					</TextInfo>
					<WrapperLink>
						<ImgArrow src={ArrowImg} />
						<Anchor href="/">Learn more</Anchor>
					</WrapperLink>
				</WrapperInfo>
			</WrapperSolution>
		);
	}
}

export default Develop;
